import React from 'react';
import MaterialTable from '@material-ui/core/Table'

const Table=()=>{
    const data=[
        {name: 'Ramesh', age:12},
        {name: 'Apple', age:12},
        {name: 'Beans', age:12},
        {name: 'Sarang', age:12}

    ]
    const columns=[
        {
            title: 'Name', field: 'name'
        },
        {
            title: 'Age', field: 'age'
        }
    ]
    return(<div>
        <MaterialTable title="Material Table"
        data={data}
        columns={columns}
        />
    </div>)
}
